fil["3963"]= "topics/reference/hm/tcl_files_r.htm@@@Tcl Files@@@Since Tcl/Tk scripts run on a variety of platforms, and there are so many use cases for accessing files, Tcl provides many commands for file manipulation...";
fil["3964"]= "topics/reference/hm/tcl_lists_r.htm@@@Tcl Lists@@@All variables in Tcl are lists. Lists can contain integers (such as list of node IDs), real numbers (such as coordinates of a node), strings, lists of other lists,\n    or a combination of all the above. A standard variable in Tcl is a list of length 1...";
fil["3965"]= "topics/reference/hm/tcl_math_expressions_r.htm@@@Tcl Mathematical Expressions@@@In Tcl, mathematical expressions are evaluated using the expr command. This command works with integers, floating point values and logical (Boolean) values. There are many arithmetic operators and built-in math functions in Tcl...";
fil["3966"]= "topics/reference/hm/tcl_namespaces_r.htm@@@Tcl Namespaces@@@Namespaces provide a means of organizing procedures and variables in Tcl...";
fil["3967"]= "topics/reference/hm/tcl_procedures_r.htm@@@Tcl Procedures@@@Procedures organize a repetitive group of commands into a logical block and allow for arguments to be parameterized. They improve performance and memory because a procedure\u2019s commands and variables only exist within the scope of the procedure...";
fil["3968"]= "topics/reference/hm/tcl_special_characters_r.htm@@@Tcl Special Characters@@@The # character is used to skip lines and insert comments. This can be used both from within tkcon as well as from within a Tcl script...";
fil["3969"]= "topics/reference/hm/tcl_strings_r.htm@@@Tcl Strings@@@The task of extracting and manipulating information via a scripting language is often described using the term string manipulation. Strings are a set of alphanumeric characters stored and manipulated together. These sets are concatenated, truncated, or partitioned by the script with a specific end in mind...";
fil["3970"]= "topics/reference/hm/tcl_tk_r.htm@@@Tcl/Tk@@@Tcl (Tool Command Language), commonly pronounced \u201Ctickle\u201D, is a scripting language like Perl, JavaScript, Born, and Korn. Scripting languages are easy to use and learn because they have a syntax that is easy to read, are platform independent, and don\u2019t require compiling...";
fil["3971"]= "topics/reference/hm/tcl_variables_r.htm@@@Tcl Variables@@@Tcl variables are always strings even when they contain numeric values. For most applications, using strings has no effect, but occasionally a HyperWorks application will expect a real number and passing a string will cause an error...";
fil["3972"]= "topics/reference/hm/tk_files_r.htm@@@Tk@@@There are Tk commands that bring up the standard Windows style file browsers for selecting directories and files to open or save...";
fil["3973"]= "topics/reference/hm/tk_gui_r.htm@@@Tk GUIs@@@Tk GUIs allow for customizing the HyperMesh interface and for creating new functionality. All of the standard widgets available in Tk, as well as additional widgets accessed through the HyperWorks GUI Toolkit (HWT) and the HyperWorks Automation Toolkit (HWAT), are available...";
