fil["3981"]= "topics/reference/hm/using_data_names_r.htm@@@Data Names@@@Data names are used to access data from the HyperMesh database. A data name is a string that represents a piece of data. They are basically generic references to the information that physically defines an entity in the HyperMesh environment...";
fil["3982"]= "topics/reference/hm/vectors_planes_r.htm@@@Vectors and Planes@@@At times, it is necessary to define a vector or plane for a command. HyperMesh allocates two vectors and two planes with the IDs 1 and 2. The vectors and planes can be defined at any time during the processing of a command file or Tcl script...";
fil["3983"]= "topics/user_interface/utility_menu_hm_r.htm@@@Utility Menu@@@The HyperMesh Utility menu allows you to customize the standard interface to create controls that include function buttons, radio options, and text that have command files and Tcl/Tk scripts associated with them...";
